CREATE TABLE mytable(
   Record_ID                               INTEGER  NOT NULL PRIMARY KEY 
  ,Aircraft_Type                           VARCHAR(8) NOT NULL
  ,Airport_Name                            VARCHAR(38) NOT NULL
  ,Altitude_bin                            VARCHAR(9) NOT NULL
  ,Aircraft_MakeModel                      VARCHAR(18) NOT NULL
  ,Wildlife_Number_struck                  VARCHAR(8) NOT NULL
  ,Wildlife_Number_Struck_Actual           INTEGER  NOT NULL
  ,Effect_Impact_to_flight                 VARCHAR(21) NOT NULL
  ,FlightDate                              VARCHAR(13) NOT NULL
  ,Effect_Indicated_Damage                 VARCHAR(13) NOT NULL
  ,Aircraft_Number_of_engines              INTEGER 
  ,Aircraft_AirlineOperator                VARCHAR(30) NOT NULL
  ,Origin_State                            VARCHAR(14) NOT NULL
  ,When_Phase_of_flight                    VARCHAR(12) NOT NULL
  ,Conditions_Precipitation                VARCHAR(4) NOT NULL
  ,Remains_of_wildlife_collected           VARCHAR(5) NOT NULL
